    render () { 
        return ( 
            <div>
        <h1>The main page</h1>
        <p>Go to <Link href="/auth"><a>Auth</a></Link></p>
        <button onClick={()=> Router.push('/auth')}>Auth</button>
    </div>
        )
    }
} 



export default IndexPage;
